    // Tabla de smbolos
    HashMap<String, ArrayList<String>> listaTablasSimbolos = new HashMap<>();
    String currentHash;

    /**
     * Mtodo: imprimirTablaSimbolos
     * Objetivo: Imprimir todas las tablas de smbolos almacenadas, mostrando el contenido de cada tabla en un formato tabular.
     * Entradas: Ninguna.
     * Salida: Se llama en MainJFlexCup para imprimir en la consola el contenido de las tablas de smbolos.
     * Detalles:
     *   - Cada tabla est asociada a una clave (nombre de la funcin o el main).
     *   - Se imprime una tabla separada para cada clave con columnas que incluyen lnea, columna, lexema y tipo.
     * Restricciones: Se espera que la estructura `listaTablasSimbolos` est correctamente inicializada y contenga las claves y los valores correspondientes.
     */
    public void imprimirTablaSimbolos() {
        for (String key : listaTablasSimbolos.keySet()) {
            System.out.println("\nTabla de smbolos: " + key);
            System.out.println("+--------+---------+----------------------+------------+");
            System.out.println("| Lnea  | Columna | Lexema              | Tipo       |");
            System.out.println("+--------+---------+----------------------+------------+");
            for (String simbolo : listaTablasSimbolos.get(key)) {
                System.out.println(simbolo);
            }
            System.out.println("+--------+---------+----------------------+------------+\n");
        }
    }

    /**
     * Mtodo: agregarTablaSimbolos
     * Objetivo: Crear una nueva tabla de smbolos asociada a una funcin o al main y agregarla al mapa de tablas de smbolos.
     * Entradas:
     *   - tipoTabla: Tipo de la tabla ("funcin" o "main").
     *   - nombre: Nombre asociado a la tabla (El nombre de la funcin o "_verano_" que es el token asociado a main).
     * Salida: Ninguna.
     * Detalles:
     *   - Se inicializa una nueva tabla de smbolos como una lista de cadenas.
     *   - Se guarda en el mapa `listaTablasSimbolos` con el nombre como clave.
     *   - `currentHash` se actualiza para indicar que la tabla activa es la recin creada.
     * Restricciones:
     *   - El nombre de la tabla debe ser nico para evitar sobrescribir tablas existentes.
     */
    public void agregarTablaSimbolos(String tipoTabla, String nombre) {
        System.out.println("/+++Nueva tabla smbolos funcin o main+++/ " + nombre);
        ArrayList<String> nuevaTabla = new ArrayList<>();
        currentHash = nombre;
        listaTablasSimbolos.put(currentHash, nuevaTabla);
    }

    /**
     * Mtodo: agregarVariable
     * Objetivo: Agregar una nueva variable a la tabla de smbolos activa, registrando su lnea, columna, lexema y tipo.
     * Entradas:
     *   - linea: Nmero de lnea donde se encuentra la variable.
     *   - columna: Nmero de columna donde se encuentra la variable.
     *   - lexema: Nombre o representacin textual de la variable.
     *   - tipo: Tipo de la variable
     * Salida: Ninguna.
     * Detalles:
     *   - Verifica que haya una tabla de smbolos activa (`currentHash`) y que esta exista en el mapa `listaTablasSimbolos`.
     *   - Si no hay tabla activa o no existe, se imprime un mensaje de error.
     *   - Si todo es vlido, formatea la informacin de la variable en una tabla y la agrega a la tabla de smbolos activa.
     * Restricciones:
     *   - Debe existir una tabla de smbolos activa antes de llamar a este mtodo.
     *   - La lnea, columna, lexema y tipo deben ser datos vlidos y coherentes con el anlisis.
     */
    public void agregarVariable(int linea, int columna, String lexema, String tipo) {
        System.out.println("PARSER: identificador (agregar o verificar) " + lexema);
        if (currentHash == null) {
            System.err.println("Error: No hay una tabla de smbolos activa");
            return;
        }
        ArrayList<String> tabla = listaTablasSimbolos.get(currentHash);
        if (tabla == null) {
            System.err.println("Error: La tabla de smbolos '" + currentHash + "' no existe");
            return;
        }
        String entrada = String.format("| %-6d | %-7d | %-20s | %-10s |",
                linea + 1, columna + 1, lexema, tipo);
        tabla.add(entrada);
    }


